--
-- Table structure for table `sensor`
--


CREATE TABLE IF NOT EXISTS `sensor` (
  `sensor_id` varchar(255) NOT NULL,
  `omschrijving` varchar(255) NOT NULL,
  PRIMARY KEY (`sensor_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

--
-- Dumping data for table `sensor`
--

INSERT INTO `sensor` (`sensor_id`, `omschrijving`) VALUES ('0','Keepalive'),('1','Schakelaar'),('2','Temperatuur'),('3','Luchtvochtigheid'),('4','Spanning (mVolt)'),('5','Stroomverbruik (Ah)');
            
drop view if exists sensor_node_observation;

create view  sensor_node_observation as           
select
		    `node`.`omschrijving` as Node
            ,`node`.`dev_eui` as DevEui
            ,`sensor`.`omschrijving` as Sensor
            ,`sensor`.`sensor_id` as SensorId
            ,`observatie`.`waarde` as ObservatieWaarde
            ,`observatie`.`datum_tijd_aangemaakt` as ObservatieDatum
            ,`observatie`.`id` as ObservatieId
			from `observatie` 
		    INNER JOIN node ON observatie.node = node.dev_eui
            INNER JOIN sensor ON observatie.sensor = sensor.sensor_id;
            

--
-- Create view for advanced reports
--

drop view if exists laatste_observatie_per_node_sensor;

create view laatste_observatie_per_node_sensor as
SELECT ObservatieId, Node, Sensor, ObservatieWaarde, ObservatieDatum
FROM sensor_node_observation sno
INNER JOIN (
  SELECT Node, Sensor, MAX(ObservatieId) AS ObservatieId
  FROM sensor_node_observation GROUP BY Node, Sensor 
) AS max USING (Node, Sensor, ObservatieId)
order by Node, Sensor,ObservatieId;

drop view if exists alarm_report;

create view alarm_report as 
select
			`alarm`.`id` as Id
            ,`node`.`omschrijving` as Node
            ,`sensor`.`omschrijving` as Sensor
            ,`alarm_regel`.`alarm_trigger` as AlarmTrigger
            ,`observatie`.`waarde` as ObservatieWaarde
			,`observatie`.`datum_tijd_aangemaakt` as Observatietijdstip
	    	from `alarm` 
			INNER JOIN alarm_regel ON alarm.alarm_regel = alarm_regel.id
            INNER JOIN node ON alarm_regel.node = node.dev_eui
            INNER JOIN sensor ON alarm_regel.sensor = sensor.sensor_id
            INNER JOIN observatie ON alarm.observatie = observatie.id;
            
            
